# Description:      This program has been created from a slice of a larger
#                   automated program I have been working on. Taking in path
#                   coordinate data, this program evaluates all the data within
#                   the list's indexes to find the shortest path's in ranges such
#                   as [0:9].
#
# Input:            Program utilizes automation without needing input, however 
#                   to make it work for the lab I have manually added the data 
#                   as path list in order for this program to function. The only
#                   input requires by the user is a choice of which path they
#                   would like to evaluate
#
# Output:           This will output the evaluation of list from the provided
#                   path showing all the optimal index's for every starting
#                   point to the nearest end point
#
# Sources:          Lab 5 specifications and video. Also a downright unhealthy 
#                   amount of staring at GH and finding ways to transform data           
#******************************************************************************
#
# pathvalid function will test if pathe number was inputted correctly
# Recieve function call with user data, assigne data as temp value "i"
# test if "i" is an int
# if "i" is an int, then test what that int is
# test if "i" is equal to 1, 2, or 3. If so then return "True"
# if "i" does not equal 1, 2, or 3, then return "False"
# if "i" is not an int, invalid data input was inputer and needs to be discarded
# return "Flase"

def pathvalid(i):
    try: 
        i = int(i)
        if i == 1 or i == 2 or i == 3:
            return True
        else:
            print("Incorrect entry, please input path number again. 1, 2, or 3")
            return False
    except:
        print("Unknown or invalid input detected, please re-input data.")
        return False

# create function Length Test
# LengthTest function will be evaluating the data at every index within the path's \
#       list and return the shortest path within the tested run
#
# when function is called, require arguments y, base, table, run, cos, and pos
# set temp variable j which holds distance to 9999999. During first run i always needs to be less than j
# Begin while loop while y is greater than base
#   pos = number of "while" loop runs in current operation 
#   set i = length of index data in table-list at index location (base-number)
#   if i is equal to or less than 2, it's an invalid entry and must be discarded, skip this index
#   elif i is less than j then i is shorter and set j = i. Set variable Location = pos
#   else i is not shorter than current distance and data can be discarded
#
#   set base = base + 1, this will tell the program to evaluate the next index
#   set pos = pos + 1, this is used to track which index's were the shortest
# oi "optimal index", use data from loop to find which index point was the shortest
# set oi = location + (run * cons), this returns a precise index number pointing to which
#       index evalualted has the shorted valid path length
# return oi and j

def LengthTest(y, base, table, run, cons, pos):
    j = 9999999
    while y > base:
        i = len(table[base])
        if 2 >= i:
            j = j
        elif j > i:
            j = i
            location = pos
        else:
            j = j
        base = base + 1
        pos = pos + 1
    oi = location + (run * cons)
    return oi, j

# create function main
# function main will handle / filter all global data and user inputs before passing
#       data to the LengthTest function for evaluation
#
# begin While True loop
#   set table = 0
#   prompt user to input which path they would like to run (path1, path2, or path3 with 1, 2, or 3)
#   set table = user input
#   set entry = called function pathvalid return with table argument
#   if entry returns true, then input is a valid option
#   set table = int(table) to safeguard data
#   break out of loop
#   else the data is bad and restart loop, reprompt user for new input
#
# if table = 1, set table = path1
# if table = 2, set table = path2
# else table = path3
# set cons = global var "u"
# set cycle = (global var "z" / cons) - 1
# set run = -1
# 
# begin While loop while cycle is greater than run
#   set run = run + 1
#   set base = base (cons * run), this tells the program the start of the evaluation. ie: [base(36):y]
#   set y = (cons * (run + 1)), this tell the program the end of the evaluation. ie: [base(36):y(45)]
#   set pos = 0, will use an internal counter for index evaluation in ListLength function
#   set oi, dist = returned value from called function LengthTest(y, base, table, run, cons, pos)
#   set j = table at index oi, this will retrieve the shortest path in distance evaluation
#   display: run number
#   display: oi, what index number in list was the most optimal (ie, shortest path found at index point)
#   display: length of the oi
#   display: path coordinates from that oi/index in the list

def main(path1, path2, path3, y, u, z):
    while True:
        table = 0
        table = (input("Which path would you like to evaluate? Enter 1, 2 or 3 to choose path number 1, 2, or 3: "))
        entry = pathvalid(table)
        if entry == True:
            table = int(table)
            break
        else:
            continue
    if table == 1:
        table = path1
    elif table == 2:
        table = path2
    else:
        table = path3
    cons = u
    cycle = (z / cons) - 1
    run = -1
    while cycle > run:
        run = run + 1
        base = (cons * run)
        y = (cons * (run + 1))
        pos = 0
        oi, dist = LengthTest(y, base, table, run, cons, pos)
        j = table[oi]
        print("Cycle number:", run)
        print("Optimal index point in list:", oi)
        print("Path distance:", dist, "units")
        print("Path coordinates:", j, "\n")
        
